import React, { useState } from "react";

const CountN = () => {
  const [count, setCount] = useState(0);
  return (
    <>
      <p>{count}</p>
      <button onClick={() => setCount(count + 1)}>Incr</button>
      <button onClick={() => setCount(count - 1)}>Decr</button>
    </>
  );
};

export default CountN;
